        const canvas = canvasRef.current;
        canvas.width = 300;
        canvas.height = 300;

    }, [])
    return(

        <canvas className="canvas" style={{"border-style" : "dotted", "width" : "300px", "height" : "300px"}}
        ref={canvasRef}
        >


        </canvas>
    )
}

export default Canvas;
